import logo from './SMlogo2.png';
import foto1 from './kon_stajnia.jpg';
import './App.css';

function App() {
  return (
    <div className="app">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <div className="Features">
      <img src={foto1} className="Stable" alt="stajnia" />
      </div>
    </div>
  );
}

export default App;
